国産旧車やネオクラシック ・ 北米仕様などのマニアな国産車趣味人向けの情報を発信している雑誌でおなじみの高速有鉛のステッカー。<br>サイズ：(W)12×(H)1.9cm <br><br>ラージサイズもあります。<style type="text/css">
/* 商品名下に境界線が入る */
span.item_name {
    display: block;
    border-bottom: 2px dotted #ddd;
    padding-bottom: 8px;
    font-size:20px
}

/* 価格に枠線がつく */
table#rakutenLimitedId_cart {
    background-color: #f8f8f8;
    border: 1px solid #ddd;
    padding: 8px;
    margin: 16px 0;
}

span.price1 {
    color: #333 !important;
    font-weight: bold;
    font-size: 80% !important;
    line-height: 30px;
    display: inline-block;
    margin-right: 16px;
}

span.catch_copy {
    color: #000000;
    font-size: 80%;
}

span.price2 {
    color: #FF0000;
    font-size: 170%;
    font-weight: bold;
}
</style>

<style>
/* 右告知用バルーン*/
#balloon-2-bottom {
	position: relative;
	padding: 0 15px;
	height: 40px;
	color: #ffffff;
	line-height: 40px;
	text-align: center;
	background-color:#900;
	z-index: 0;
	margin: 0px 0px 20px 0px;
}
#balloon-2-bottom:after {
	content: "";
	position: absolute;
	bottom: -10px; left: 50%;
	margin-left: -10px;
	display: block;
	width: 0px;
	height: 0px;
	border-style: solid;
	border-width: 10px 10px 0 10px;
	border-color: #900 transparent transparent transparent;
}

#kokuti-1{
	position:fixed;
	bottom:10%;
	right:0%;
	line-height: 10px;
    font-size: 8px;
    font-weight: bold;
}

/* 右告知用バルーン*/
