	border-width: 10px 10px 0 10px;
	border-color: #900 transparent transparent transparent;
}

#kokuti-1{
	position:fixed;
	bottom:10%;
	right:0%;
	line-height: 10px;
    font-size: 8px;
    font-weight: bold;
}

div.bookmarkArea div.bkm a.addBkm span.bkmStar {
background: url(http://www.rakuten.ne.jp/gold/mooneyes/2015/img/fav-item.jpg) no-repeat 0 0 !important;
display: inline-block !important;
width: 259px !important;
height: 100px !important;
}

div.shopBookmarkArea div.shopBkm a.addShopBkm span.shopBkmStar {
background: url(http://www.rakuten.ne.jp/gold/mooneyes/2015/img/fav-shop.jpg) no-repeat 0 0 !important;
display: inline-block !important;
    width: 259px !important;
    height: 40px !important;
}

</style>


